import React from 'react';
import { Image } from 'semantic-ui-react'

const _SearchMovieListDisplay = (props) => {

    return (
        <React.Fragment>
            <center className="customImageDisplay">
                <Image onClick={() => props.movieDetials(props.movie.id)} src={props.movieImage} className="sizeOfNewSearchMovie" />
            </center>
        </React.Fragment >
    )
}

export default _SearchMovieListDisplay;
